INSERT INTO `hdata` VALUES ('11898x20x6', 'http://beijing.haodai.com/xiaofei/11898x20x6.html', '北京玖富时代投资顾问有限公司', '20', '6', '38193', '3', '月管理费 2.43%', '1.00～50.00 万元', '6～36 个月', '分期还款', '5', '330', '20-60周岁、正式员工、月收入2000及以上', '1、申请表、身份证', '1、薪易贷风险客户：原则上将美容店、公检法（法官、一线警察）、快递员、培训公司员工、律师归为风险类客户，可以依据客户实际条件做适当调整', 'http://beijing.haodai.com/Public/upload/bank/12726.gif', '信用贷', 'hdstars Sval_5', '20-60周岁;正式员工;月收入2000及以上', '放贷速度快;手续简便', 'http://beijing.haodai.com/Public/upload/xindai/tag/12.png;http://beijing.haodai.com/Public/upload/xindai/tag/25.png;');
