INSERT INTO `hdata` VALUES ('9496x20x6', 'http://beijing.haodai.com/xiaofei/9496x20x6.html', '宁波银行北京分行', '20', '6', '35633', '1', '参考月利率 0.50% 月管理费 0.65%', '1.00～50.00 万元', '6～12 个月', '分期还款', '3', '638', '25-60周岁、月收入4000元以上、非本地户籍需有房产', '一、属于公务员、事业单位、优质企业及九大行业的员工，需提供下列资料 1、申请人（及配偶）身份证明 2、婚姻证明 二、属于外资企业及普通企业编制性质的，需提供下列资料 1、申请人（及配偶）身份证明 2、婚姻证明 3、户籍证明 4、收入证明：由单位人事部门开具 5、资质证明：本人职称、执业资格、学历（学位）证书（可选择提供，有益于提高额度） ', '白领通主要面对白领阶层，包括：公务员；教师、医生或其他事业单位编制人员；企业单位的中高级管理人员（企业注册资金原则上1000万元以上）；电信、电力、烟草、炼化、港务、盐务、金融、律师、会计师等行业普通工作人员', 'http://beijing.haodai.com/Public/upload/bank/1684.gif', '信用贷', 'hdstars Sval_25', '25-60周岁;月收入4000元以上;非本地户籍需有房产', '3天放款;仅特定人群;利率较低', 'http://beijing.haodai.com/Public/upload/xindai/tag/4.png;http://beijing.haodai.com/Public/upload/xindai/tag/16.png;http://beijing.haodai.com/Public/upload/xindai/tag/19.png;');
